@neutral235 My issue is: Should we be defaming a book, the Torah, which our greatest scholars believed was from Allah swt? True, these scholars may be wrong. But shouldn't we err on the side of caution? 

Furthermore, the fact that these scholars believed that it was written by Allah swt implies that the Torah must, at the very least, be a good book. There is no way that our greatest scholars would make such an EGREGIOUS mistake, believing that an EVIL book is actually ALLAH's book!

You follow?

@rrost1500 I appreciate your concernits true that the original Torah  was a divine revelation sent to Prophet Musa AS , as affirmed in the Quran (5:44). However, the Quran also makes clear that previous scriptures were altered: (2:79), and  (5:13). So while the Torah was from Allah, what we have today is a corrupted version, mixed with historical narrative like stories of Adam AS and Noah AS, genealogies, and claims that contradict the Quran. the original Torah would have looked like Quran most of part being the commands of god reading the first 5 book of old testament clearly indicates that it's written over a large span of years .

A clear example is the accusation in the Old Testament that Prophet Haroon ( ) was involved in idol worship (Exodus 32), whereas the Quran explicitly exonerates him and blames the Smir (20:8595). Thus, we are not defaming the Torah when we critique such content which contradicts the Quran we are applying the Quran as al-Furqn (25:1), the criterion that judges previous scriptures. This is a Quranic mandate, not disrespect.

As for scholars of the past: in Islam, no scholar is infallible not even the greatest. Unlike Catholicism, we dont consider scholars like Imam juwaini, IBN tayamiiyah o or al-Ghazl to be free from error. Their views are respected, but always subject to correction by the Quran and Sunnah. So if some scholars overestimated the reliability of the Torah in its current form, that doesnt undermine their scholarship but it also doesnt bind us to their conclusions when we have clear Quranic evidence to the contrary.
